import React from "react";
import PropTypes from "prop-types";
import { NavLink } from "react-router-dom";
import cn from 'classnames';
import logo from '../../public/images/tk_logo.png';
import classes from './Header.module.scss';

const Header = () => {
  const activeStyle = { color: 'blue' };
  return (
    <header className="header-container">
      <NavLink to="/">
        <div className="logo">
          <img src={logo} alt="Logo" />
          <div className={cn('logo-text', 'bold')}>Tong's{"\n"}Kitchen</div>
        </div>
      </NavLink>

      <nav>
        <NavLink className="header-link" to="/recipes">Recipes</NavLink>
        <NavLink className="header-link" to="/about">About</NavLink>
      </nav>
    </header>
  );
};

export default Header;
